INSERT INTO `app_policy_details` VALUES (1,'5.0.0','47','Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. \nIt has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. \n\nIt was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.\n\nLorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. ','لوريم إيبسوم هو ببساطة نص شكلي يستخدم في صناعة الطباعة والتنضيد. كان Lorem Ipsum هو النص الوهمي القياسي في الصناعة منذ القرن الخامس عشر الميلادي ، عندما أخذت طابعة غير معروفة لوحًا من النوع وتدافعت عليه لصنع كتاب عينة من النوع. لقد نجت ليس فقط خمسة قرون ، ولكن أيضًا القفزة في التنضيد الإلكتروني ، وظلت دون تغيير جوهري.\n\nتم نشره في الستينيات من القرن الماضي مع إصدار أوراق Letraset التي تحتوي على مقاطع Lorem Ipsum ، ومؤخرًا مع برامج النشر المكتبي مثل Aldus PageMaker بما في ذلك إصدارات Lorem Ipsum.\n\nلوريم إيبسوم هو ببساطة نص شكلي يستخدم في صناعة الطباعة والتنضيد. كان Lorem Ipsum هو النص الوهمي القياسي في الصناعة منذ القرن الخامس عشر الميلادي ، عندما أخذت طابعة غير معروفة لوحًا من النوع وتدافعت عليه لصنع كتاب عينة من النوع.','https://mk0bfsieletsonlt96u6.kinstacdn.com/wp-content/uploads/2017/11/Rak-Bank.jpg','# Privacy Policy\n\nThe National Bank of Ras Al Khaimah (P.S.C.) (“RAKBANK”) is committed to providing the highest level of security and privacy regarding the collection and use of the customer’s personal information by the RAKBANK website. Personal information may be collected through the submission of service requests, online banking transactions or through the use of online financial tools such as interactive calculators. A detailed description of RAKBANK’s website privacy policy is provided below. If you have additional questions regarding the privacy and security of your personal information, please contact us on 04-2130000 or [reportphishing@rakbank.ae](reportphishing@rakbank.ae \"reportphishing@rakbank.ae\").\n\n# Respect of right to privacy\n\nRAKBANK maintains strict policies and security controls to ensure that customer information contained in the systems and files is protected. RAKBANK respects your right to privacy and takes every precaution to provide you with the same level of privacy within our bank that you receive through more traditional bank delivery channels. RAKBANK is committed to ensuring the privacy of its customers’ personal information.\n\n# Collection and use of personal information\n\nThe collection of personal information online is designed to protect access to your accounts, to assist RAKBANK in providing you with the products and services you want and need. All personal information collected and stored by RAKBANK is used for specific business purposes to protect and administer your accounts and transactions, to comply with federal laws and banking regulations of the United Arab Emirates (“UAE”), and to help RAKBANK better understand your financial needs in order to design or improve our products and services. Employing stringent security measures in the collection of your personal information, all RAKBANK service requests are submitted to the secure administration site of RAKBANK. Once received by RAKBANK, only the bank’s approved personnel may open and process the application. Furthermore, auditing mechanisms have been put into place to further protect your information by identifying which employee(s) has accessed and in any way modified for example, updated or added to your personal information.\n\nUnless restricted by applicable law, you agree that any and all personal information/data relating to you collected by RAKBANK from this website from time to time may be used and disclosed for such purposes and to such persons be in accordance with RAKBANK’s Privacy Policy. RAKBANK never requests its customers to disclose the account number, credit card information, user ID, Personal Identification Number (PIN) or any such information through e-mails. Any e-mail or written communication received by the customer, which appears to have been sent from RAKBANK seeking a customer’s personal and confidential information, should not be answered and RAKBANK should be advised.\n\n# Limited employee access to personal information\n\nRAKBANK limits its access to your personal information to only those employees who hold a business reason for having access to such information. RAKBANK also educates all their employees about the importance of confidentiality and customer privacy. In addition, individual usernames and passwords are used by approved RAKBANK personnel to access your personal information online, providing audit trails to further safeguard the privacy of your personal information.\n\n# Third-party disclosure restrictions\n\nRAKBANK follows strict privacy procedures in regard to protecting your personal information. In addition, RAKBANK requires all third parties with a business need to access this information to adhere to similar and equally stringent privacy policies. Personal information may be supplied to a third party in order to process customer transactions; if the customer requests it; the disclosure is required or allowed by law (i.e. exchange of information with reputable reporting agencies, subpoena, or the investigation of fraudulent activity, etc.); or in conjunction with joint marketing agreements we have entered into. RAKBANK does not provide account or personal information to other companies for the purpose of independent telemarketing or direct mail marketing of any non-financial products or services of those companies.\n\n# Online protection\n\nRAKBANK has taken all appropriate measures to protect the personal information provided by you to RAKBANK and uses several security levels.\n','https://mk0bfsieletsonlt96u6.kinstacdn.com/wp-content/uploads/2017/11/Rak-Bank.jpg',1,'2020-09-08 05:55:45','2020-11-12 09:46:13',NULL),(2,'1.0.0','1','Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. \nIt has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. \n\nIt was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.\n\nLorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. ','لوريم إيبسوم هو ببساطة نص شكلي يستخدم في صناعة الطباعة والتنضيد. كان Lorem Ipsum هو النص الوهمي القياسي في الصناعة منذ القرن الخامس عشر الميلادي ، عندما أخذت طابعة غير معروفة لوحًا من النوع وتدافعت عليه لصنع كتاب عينة من النوع. لقد نجت ليس فقط خمسة قرون ، ولكن أيضًا القفزة في التنضيد الإلكتروني ، وظلت دون تغيير جوهري.\n\nتم نشره في الستينيات من القرن الماضي مع إصدار أوراق Letraset التي تحتوي على مقاطع Lorem Ipsum ، ومؤخرًا مع برامج النشر المكتبي مثل Aldus PageMaker بما في ذلك إصدارات Lorem Ipsum.\n\nلوريم إيبسوم هو ببساطة نص شكلي يستخدم في صناعة الطباعة والتنضيد. كان Lorem Ipsum هو النص الوهمي القياسي في الصناعة منذ القرن الخامس عشر الميلادي ، عندما أخذت طابعة غير معروفة لوحًا من النوع وتدافعت عليه لصنع كتاب عينة من النوع.','# About us\n\nLorem Ipsum is simply dummy text of the