vacy policies. Personal information may be supplied to a third party in order to process customer transactions; if the customer requests it; the disclosure is required or allowed by law (i.e. exchange of information with reputable reporting agencies, subpoena, or the investigation of fraudulent activity, etc.); or in conjunction with joint marketing agreements we have entered into. RAKBANK does not provide account or personal information to other companies for the purpose of independent telemarketing or direct mail marketing of any non-financial products or services of those companies.  # Online protection  RAKBANK has taken all appropriate measures to protect the personal information provided by you to RAKBANK and uses several security levels.','https://mk0bfsieletsonlt96u6.kinstacdn.com/wp-content/uploads/2017/11/Rak-Bank.jpg',1,'2020-11-24 13:46:37','2020-11-24 13:46:37',NULL),(8,'1.0.7','1','These Terms and Conditions governing the Application **(\"Terms and Conditions\")** provided by The National Bank of Ras Al Khaimah (P.S.C) a public joint stock company **(\"the Bank\")** shall govern the use by the Customers of this Application and shall be read in conjunction with the Product Terms and Conditions as provided by the relevant Merchants, as applicable. These Terms and Conditions shall be read and understood before using any of the services provided in the Application. By ticking the box of “Terms and Conditions” on the Application, downloading, installing, accessing or using the Application, each Customer accepts these Terms and Conditions under which the Application may be used. \n\nAny time use/transaction/enquiry/chat through the Application implies that the Customer has fully read, understood and accepted these Terms and Conditions. \nProducts are offered by selected Merchants on the Application to the Bank’s Customers and are subject to the approval and decision of the Merchants and the Product Terms and Conditions. Discounts and special offers are entirely discretionary to the Bank and the relevant Merchants and may vary from one Product to another.  Any special offers may be for a limited period and may be discontinued or modified without notice.\nThe Application is for the Customer’s information purpose only and the Bank is neither responsible for, nor guarantees or warrants the quality, fitness for purpose, suitability of the Products being offered and does not accept any liability and will not be liable for any loss or damage arising directly or indirectly to the Customer availing or purchasing the Product from a Merchant. The decision to purchase a Product and dealing with any Merchant is the sole responsibility of the Customer and the Customer shall do its own due diligence and assume any risk associated with such decision. \n\n## Definitions: \n\nThe following words and phrases shall have the meanings set out below, unless the context provides otherwise:\n\n**Application** means a software application named Falcon which is owned, established and maintained by the Bank and which is accessed by Customers. \n\n**Customer** means any customer of the Bank (whether individual or entity) being the user accessing the Application holding a valid Emirates Skywards credit card and such other Cards issued by the Bank from time to time as determined by the Bank at its sole discretion. A reference to Customer shall include all genders or a body corporate in any form including sole establishment, as relevant.\n\n**Intellectual Property Rights** means any and all intellectual and industrial property rights throughout the world including rights in respect of or in connection with confidential information, copyright (including future copyright and rights in the nature of or analogous to copyright), inventions (including patents), trademarks, service marks, designs and circuit layouts, whether existing now or in the future, and whether or not registered or registrable, and includes any right to apply for the registration of such rights and includes all renewals and extensions.\n\n**Merchant** means any company that is licensed to provide, accept to provide and sells Products for the purpose of the Application it also means any Merchant that provides any services to a Customer and shall be construed accordingly.\n\n**Products** mean various products such as goods and services as may be provided or sold or delivered by any Merchant which are marketed and/or distributed by the Bank through the Application as may be changed from time to time.\n\n**Product Terms and Conditions** means a document detailing the terms and conditions applicable to the Product, including the features, particulars, offers and other terms and conditions governing the relevant Product and the purchase by the Customer of that Product from the Merchant.\n\n**Service Provider means** a service provider engaged by or on behalf of the Bank to provide services on the Application.\n\n**UAE** means United Arab Emirates.\n\n**Business Hours** means the hours between 9am to 5pm on Sunday through Thursday, excluding public holidays in the United Arab Emirates. \n\n\n## Interpretations: \n  * The headings in these Terms and Conditions are inserted for convenience purposes only and shall not affect the construction of these Terms and Conditions. \n  * Except where the context otherwise requires, words denoting the singular shall include the plural and vice versa, words denoting a gender shall include every gender. \n  *	Any reference to a person includes any individual, company, partnership firm, corporation or other legal entity (incorporated or otherwise), whatsoever.\n\n* **Products and Services**\n     * Products and services of Merchants are marketed and distributed by the Bank or offered by the Bank under the Application are available only at the discretion of the Bank and subject to the relevant Products Terms and Conditions prescribed by the relevant Merchant.  Accordingly, the range of Products marketed on the Applicati