rms and Conditions and Product details, before the Customer purchases any Product.\n	* The Customer should read the Product features, service document / certificate that is issued by the Merchant after the purchase of the relevant Product. Delivering the Product and Product Terms and Conditions to the Customer is the sole responsibility of the Merchant and, accordingly, the Bank is not liable for any failure or delay in connection with this.\n	* The Application contains factual information on the Products marketed by the Bank and the Bank does not provide or sell any of these Products or provide any insurance or financial or other advice of any kind in relation to any Product that is displayed on the Application, nor does the Bank recommend or endorse any Product as suitable for a Customer. The choice is for the Customer solely to make based on the factual information displayed and found in the Product documentation provided by the Merchants and the Product Terms and Conditions.\n	* If the Customer has any doubt as to the suitability or adequacy of any Product to purchase through this Application, the Customer should seek advice from the Merchant or an independent professional advisor.  The Bank will not give or offer any such advice.\n\n* **Usage of the Application**\n    * Usage of the Application is primarily for the Customers to order and purchase Products or services from the Merchants. \n	*	Setting up the Customer’s Account: The Customer shall register in the Application by providing the Bank with the information set forth on the Application’s registration pages, including a valid email address and mobile phone number, sign-in message and password. The Customer will then store Payment Information (cardholder name, card number, expiration date, and security code), billing information and other information for credit or debit cards, as applicable (each a “Card”) for card-on-file payment through the Application along with other information indicated on the Application’s registration page. All of the information for the Customer’s Card and related information are collectively referred to as the Customer’s “Payment Information”. \n    * The Customer is solely responsible for maintaining up-to-date and accurate information pertaining to the Customer’s account in the Application, including without limitation all Payment Information. The Bank does not represent or warrant the authenticity, validity, accuracy or completeness of the Payment Information that the Bank may transmit on the Customer’s behalf.  \n    * Location Enabled Features: Certain location-enabled functionality and information may be made available in the Application. The Customer must exercise its own judgment as to the adequacy and appropriateness of the information. To the extent permitted by law, all location-based information is provided entirely \"as is\" without warranties of any kind.\n    *  Support Team: The Bank is only responsible for addressing any questions, comments or claims relating to the Application, non-functionality of the Application and the Customer’s use of the Application. If the Customer has any comments, questions or complaints relating to the Application, the Customer may contact the Bank by sending an e-mail to: contactus@Falcon.ae. Any questions or queries relating to any Product offered on the Application cannot be addressed to the Bank and, if so addressed, will not be attended to or responded to by the Bank.  Any questions or queries should be directed to the relevant Merchant selling that Product.\n\n* **Customer’s Undertakings and Responsibilities**\n  * The Customer must be lawfully able to enter into contracts. The Customer is solely responsible for evaluating and selecting the Products which the Customer orders or purchases using the Application. The Customer shall be solely responsible for ensuring that the usage of the Application is in compliance with all applicable laws, rules and regulations.  \n  *	The Customer is aware 