ons. By purchasing a Product or service through the Application, the Customer agrees to all the Merchant’s terms and conditions and acknowledges that the Customer is solely responsible for purchasing that Product or service and that the Bank is not liable for this choice.\n  *	It is of utmost importance that all the information provided by the Customer through the Application is true and accurate and the Customer has answered all questions to the best of the Customer’s knowledge. The Bank does not accept any responsibility if any Customer fails to provide full and accurate information through the Application to the Merchants or in any way misrepresented or failed to disclose the facts.\n  *	The Bank at all times will comply with United Nations, European Union, United States, United Kingdom HM Treasury, UAE and Arab league (“Sanctions Authority”) sanctions. The Customer represents and warrants that: (i) the Customer is not located in a country that is subject to an embargo, or that has been designated by any Sanctions Authority as a \"terrorist supporting\" country; and (ii) the Customer is not listed on any list of prohibited or restricted parties issued by any Sanctions Authority.\n\n* **Privacy policy**\n	* The Customer agrees that any and all personal information/data relating to the Customer collected by the Bank in connection with the Customer’s use of the Application from time to time may be used and disclosed for such purposes and to such persons as may be determined by the Bank in its sole discretion in accordance with the Bank’s Privacy Policy. \n	* The Bank recognizes the importance of respecting the privacy of those who visit or use the Application or any other application of the Bank. The Bank’s Privacy Policy (https://rakbank.ae/wps/portal/footer/privacy-policy) provides a description of how the Bank collects, uses, shares and protects personal information of its users, as well as the choices and access rights users have in regards to such personal information in connection with this Application. Customers should carefully review the Bank’s Privacy Policy.\n\n* **Purchase of Products**\n    *	Nothing on this Application shall constitute or be deemed to constitute an offer by the Bank or any third party to sell a Customer any Product or service or to enter into any contract with the Customer in respect of such Product or service. A Customer by submitting its details is making an offer to purchase the relevant Product from the relevant Merchant that may be accepted or rejected by the relevant Merchant. The contract for the purchase of the Product will only be concluded, once the Merchant has accepted the Customer’s offer. The Product will be serviced, dispatched, issued through the Merchant’s system in good faith in the name of the Customer. \n    *	The Bank and / or the Merchant will contact the Customer if any further documents or clarification is required at any time before or after the purchase or issuance of the Product.\n    *	A Customer may be required, as a condition for the purchase of a Product, to produce and upload certain personal documents. Once uploaded and verified and payment cleared the purchase of the Product may be accepted or declined at the sole discretion of the relevant Merchant.\n    *	The information displayed in the Application is provided to the Bank directly from each relevant Merchant. The Bank is not responsible for the content of the information set out in the Application and accepts no liability of any kind for any inaccuracy in the description of Products on the Application.\n    *	The Merchants will make the Product details, particulars available to the Customer via delivery as an electronic document. It is important that the Customer reads the terms of the Product issued to the Customer carefully and familiarize themselves with the Product Terms and Conditions and such other terms and conditions which shall govern the contract between the Customer and the Merchants, including the 