onal information by the RAKBANK website. Personal information may be collected through the submission of service requests, online banking transactions or through the use of online financial tools such as interactive calculators. A detailed description of RAKBANK’s website privacy policy is provided below. If you have additional questions regarding the privacy and security of your personal information, please contact us on 04-2130000 or [reportphishing@rakbank.ae](reportphishing@rakbank.ae \"reportphishing@rakbank.ae\").  # Respect of right to privacy  RAKBANK maintains strict policies and security controls to ensure that customer information contained in the systems and files is protected. RAKBANK respects your right to privacy and takes every precaution to provide you with the same level of privacy within our bank that you receive through more traditional bank delivery channels. RAKBANK is committed to ensuring the privacy of its customers’ personal information.  # Collection and use of personal information  The collection of personal information online is designed to protect access to your accounts, to assist RAKBANK in providing you with the products and services you want and need. All personal information collected and stored by RAKBANK is used for specific business purposes to protect and administer your accounts and transactions, to comply with federal laws and banking regulations of the United Arab Emirates (“UAE”), and to help RAKBANK better understand your financial needs in order to design or improve our products and services. Employing stringent security measures in the collection of your personal information, all RAKBANK service requests are submitted to the secure administration site of RAKBANK. Once received by RAKBANK, only the bank’s approved personnel may open and process the application. Furthermore, auditing mechanisms have been put into place to further protect your information by identifying which employee(s) has accessed and in any way modified for example, updated or added to your personal information.  Unless restricted by applicable law, you agree that any and all personal information/data relating to you collected by RAKBANK from this website from time to time may be used and disclosed for such purposes and to such persons be in accordance with RAKBANK’s Privacy Policy. RAKBANK never requests its customers to disclose the account number, credit card information, user ID, Personal Identification Number (PIN) or any such information through e-mails. Any e-mail or written communication received by the customer, which appears to have been sent from RAKBANK seeking a customer’s personal and confidential information, should not be answered and RAKBANK should be advised.  # Limited employee access to personal information  RAKBANK limits its access to your personal information to only those employees who hold a business reason for having access to such information. RAKBANK also educates all their employees about the importance of confidentiality and customer privacy. In addition, individual usernames and passwords are used by approved RAKBANK personnel to access your personal information online, providing audit trails to further safeguard the privacy of your personal information.  # Third-party disclosure restrictions  RAKBANK follows strict privacy procedures in regard to protecting your personal information. In addition, RAKBANK requires all third parties with a business need to access this information to adhere to similar and equally stringent privacy policies. Personal information may be supplied to a third party in order to process customer transactions; if the customer requests it; the disclosure is required or allowed by law (i.e. exchange of information with reputable reporting agencies, subpoena, or the investigation of fraudulent activity, etc.); or in conjunction with joint marketing agreements we have entered into. RAKBANK does not provide account or personal information to other companies for the purpose of independent telemarketing or direct mail marketing of any non-financial products or services of those companies.  # Online protection  RAKBANK has taken all appropriate measures to protect the personal information provided by you to RAKBANK and uses several security levels.','https://mk0bfsieletsonlt96u6.kinstacdn.com/wp-content/uploads/2017/11/Rak-Bank.jpg',1,'2020-11-27 12:52:57','2020-12-04 06:36:03',NULL),(9,'1.0.8','1','These Terms and Conditions governing the Application **(\"Terms and Conditions\")** provided by The National Bank of Ras Al Khaimah (P.S.C) a public joint stock company **(\"the Bank\")** shall govern the use by the Customers of this Application and shall be read in conjunction with the Product Terms and Conditions as provided by the relevant Merchants, as applicable. These Terms and Conditions shall be read and understood before using any of the services provided in the Application. By ticking the box of “Terms and Conditions” on the Application, downloading, installing, accessing or using the Application, each Customer accepts these Terms and Conditions under which the Application may be used. \n\nAny time use/transaction/enquiry/chat through the Application implies that the Customer has fully read, understood and accepted these Terms and Conditions. \nProducts are offered by selected Merchants on the Application to the Bank’s Customers and are subject to the approval and decision of the Merchants and the Product Terms and Conditions. Discounts and special offers are entirely discretionary to the Bank and the relevant Merchants and may vary from one Product to another.  Any special offers may be for a limited period and may be discontinued or modified without notice.\nThe Application is for the Customer’s information purpose only and the Bank is neither responsible for, nor guarantees or warrants the quality, fitness for purpose, suitability of the Products being offered and does not accept any liability and will not be liable for 