iminal proceeds and the Customer assumes all responsibility for the authenticity and lawfulness of its transactions. \n	* The Bank is not responsible for addressing or dealing with, nor is it liable  for, any claims that the Customer may make relating to the Products as displayed on the Application or the Customer’s possession of or use of any Product purchased through the Application including but not limited to: (a) product or service liability claims; (b) any claim that the Product fails to conform to any applicable legal or regulatory requirement; and (c) claims arising under consumer protection or similar legislations; (d)  the investigation, defense, settlement or discharge of any third party claim that the Product infringes that third party\'s intellectual property rights.\n\n* ## Third Parties:\n* **Third Party Content:** The Application may contain third party content including Merchant’s content **(\"Third Party Content\")** and links to Merchant’s and third party sites **(“Third Party Sites”)** that are completely independent of the Application and not owned or controlled by the Bank. Third Party Content and links to Third Party Sites are included solely for the convenience of the Customer and do not constitute any approval, endorsement or warranty by the Bank. The Bank is not responsible for the content, security, operation, or use of any Third Party Content or Third Party Sites, or the products or services that may be offered or obtained through them or for the accuracy, completeness, or reliability of any information obtained from any Third Party Content or Third Party Sites. When the Customer may click on a link to a Third Party Site, the Customer will leave the Application. Any personal information the Customer submits after the Customer has left the Application will not be collected or controlled by the Bank. It will be subject to the privacy notice or terms of use applicable to the relevant Third Party Site. It is the Customer’s responsibility to r