ovisions of these Terms and Conditions shall remain in full force and effect.\n	* The Bank reserves all rights not expressly granted under these Terms and Conditions, and no other rights are granted by implication or estoppel or otherwise.\n\n* **Governing Law and Jurisdiction**\n	* The Bank controls and maintains the Application from the UAE and the Bank makes no representation that the material and information contained in the Application or in these Terms and Conditions are appropriate or available for use in other locations/jurisdictions. \n	* These Terms and Conditions shall be governed by and construed in accordance with the Federal laws of the UAE as applied by the Courts of the Emirate of Dubai, as applicable from time to time and the Customer hereby irrevocably submits to the exclusive jurisdiction of the Courts in Dubai to hear and determine any suit, action or proceeding and to settle any disputes which may arise out of or in connection with these Terms and Conditions.\n	* The Customer irrevocably waives any objection which it might now or hereafter have to the Courts referred to in the preceding clause being nominated as the exclusive forum to hear and determine any suit, action or proceeding and to settle any disputes which may arise out of or in connection with these Terms and Conditions made hereunder and agrees not to claim that any such Court is not a convenient or appropriate forum.\n	* Submission to the jurisdiction of the Courts of Dubai shall not limit the right of the Bank to bring proceedings against the Customer in any other court in any other jurisdiction nor shall taking proceedings in any one or more jurisdictions shall preclude taking proceedings in any other jurisdiction, whether concurrently or not.','لوريم إيبسوم هو ببساطة نص شكلي يستخدم في صناعة الطباعة والتنضيد. كان Lorem Ipsum هو النص الوهمي القياسي في الصناعة منذ القرن الخامس عشر الميلادي ، عندما أخذت طابعة غير معروفة لوحًا من النوع وتدافعت عليه لصنع كتاب عينة من النوع. لقد نجت ليس فقط خمسة قرون ، ولكن أيضًا القفزة في التنضيد الإلكتروني ، وظلت دون تغيير جوهري.  تم نشره في الستينيات من القرن الماضي مع إصدار أوراق Letraset التي تحتوي على مقاطع Lorem Ipsum ، ومؤخرًا مع برامج النشر المكتبي مثل Aldus PageMaker بما في ذلك إصدارات Lorem Ipsum.  لوريم إيبسوم هو ببساطة نص شكلي يستخدم في صناعة الطباعة والتنضيد. كان Lorem Ipsum هو النص الوهمي القياسي في الصناعة منذ القرن الخامس عشر الميلادي ، عندما أخذت طابعة غير معروفة لوحًا من النوع وتدافعت عليه لصنع كتاب عينة من النوع.','# About us  Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.  It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged.   It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.  Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. ','# Privacy Policy  The National Bank of Ras Al Khaimah (P.S.C.) (“RAKBANK”) is committed to providing the highest level of security and privacy regarding the collection and use of the customer’s personal information by the RAKBANK website. Personal information may be collected through the submission of service requests, online banking transactions or through the use of online financial tools such as interactive calculators. A detailed description of RAKBANK’s website privacy policy is provided below. If you have additional questions regarding the privacy and security of your personal information, please contact us on 04-2130000 or [reportphishing@rakbank.ae](reportphishing@rakbank.ae \"reportphishing@rakbank.ae\").  # Respect of right to privacy  RAKBANK maintains strict policies and security controls to ensure that customer information contained in the systems and files is protected. RAKBANK respects your right to privacy and takes every precaution to provide you with the same level of privacy within our bank that you receive through more traditional bank delivery channels. RAKBANK is committed to ensuring the privacy of its customers’ personal information.  # Collection and use of personal information  The collection of personal information online is designed to protect access to your accounts, to assist RAKBANK in providing you with the products and services you want and need. All personal information collected and stored by RAKBANK is used for specific business purposes to protect and administer your accounts and transactions, to comply with federal laws and banking regulations of the United Arab Emirates (“UAE”), and to help RAKBANK better understand your financial needs in order to design or improve our products and services. Employing stringent security measures in the collection of your personal information, all RAKBANK service requests are submitted to the secure administration site of RAKBANK. Once received by RAKBANK, only the bank’s approved personnel may open and process the application. Furthermore, auditing mechanisms have been put into place to further protect your information by identifying which employee(s) has accessed and in any way modified for example, updated or added to your personal information.  Unless restricted by applicable law, you agree that any and all personal information/data relating to you collected by RAKBANK from this website from time to time may be used and disclosed for such purposes and to such persons be in accordance with RAKBANK’s Privacy Policy. RAKBANK never requests its customers to disclose the account number, credit card information, user ID, Personal Identification Number (PIN) or any such information through e-mails. Any e-mail or written communication received by the customer, which appears to have been sent from RAKBANK seeking a customer’s personal and confidential information, should not be answered and RAKBANK should be advised.  # Limited employee access to personal information  RAKBANK limits its access to your personal information to only those employees who hold a business reason for having access to such information. RAKBANK also educates all their employees about the importance of confidentiality and customer privacy. In addition, individual usernames and passwords are used by approved RAKBANK personnel to access your personal information online, providing audit trails to further safeguard the privacy of your personal information.  # Third-party disclosure restrictions  RAKBANK follows strict privacy procedures in regard to protecting your personal information. In addition, RAKBANK requires all third parties with a business need to access this information to adhere to similar and equally stringent privacy policies. Personal information may be supplied to a third party in order to process customer transactions; if the customer requests it; the disclosure is required or allowed by law (i.e. exchange of information with reputable reporting agencies, subpoena, or the investigation of fraudulent activity, etc.); or in conjunction with joint marketing agreements we have entered into. RAKBANK does not provide account or personal information to other companies for the purpose of independent telemarketing or direct mail marketing of any non-financial products or services of those companies.  # Online protection  RAKBANK has taken all appropriate measures to protect the personal information provided by you to RAKBANK and uses several security levels.','https://mk0bfsieletsonlt96u6.kinstacdn.com/wp-content/uploads/2017/11/Rak-Bank.jpg',1,'2020-12-04 05:25:13','2020-12-04 06:36:03',NULL);
